import React from 'react';
import { motion } from 'framer-motion';

const TechStack = () => {
  const techStack = [
    { name: 'TypeScript', icon: 'TS' },
    { name: 'React', icon: '⚛️' },
    { name: 'Next.js', icon: 'N' },
    { name: 'JavaScript', icon: 'JS' },
    { name: 'Node.js', icon: '⬢' },
    { name: 'Express', icon: 'E' },
    { name: 'MongoDB', icon: 'M' },
    { name: 'PostgreSQL', icon: 'P' },
    { name: 'GraphQL', icon: 'G' },
  ];

  return (
    <section id="skills" className="min-h-screen py-20 bg-gradient-to-b from-gray-900 to-gray-800 text-white relative">
      <div className="container mx-auto px-4 pt-20">
        <div className="relative">
          <h2 className="text-4xl md:text-5xl font-bold mb-12 inline-block relative">
            &lt;/Skills&gt;
            <span className="absolute bottom-0 left-0 w-full h-1 bg-gradient-to-r from-pink-500 to-purple-600 rounded-full"></span>
          </h2>

          <h3 className="text-2xl font-semibold mb-8">Tech Stack</h3>

          <div className="grid grid-cols-3 md:grid-cols-4 lg:grid-cols-5 gap-6 max-w-4xl">
            {techStack.map((tech, index) => (
              <motion.div
                key={tech.name}
                className="flex flex-col items-center p-4 bg-gray-800/50 rounded-lg backdrop-blur-sm hover:bg-gray-700/50 transition-colors group"
                whileHover={{ y: -5 }}
                initial={{ opacity: 0, y: 20 }}
                whileInView={{ opacity: 1, y: 0 }}
                viewport={{ once: true }}
                transition={{ duration: 0.3, delay: index * 0.05 }}
              >
                <div className="w-16 h-16 rounded-full bg-gradient-to-br from-purple-600 to-pink-600 flex items-center justify-center text-2xl font-bold mb-2 group-hover:scale-110 transition-transform">
                  {tech.icon}
                </div>
                <span className="text-sm font-medium text-gray-300 group-hover:text-white transition-colors">
                  {tech.name}
                </span>
              </motion.div>
            ))}
          </div>
        </div>
      </div>

      {/* Back to top link */}
      <div className="fixed right-10 top-1/2 transform -translate-y-1/2 rotate-90 origin-right text-sm text-gray-400 hover:text-white transition-colors">
        <a href="#" className="flex items-center">
          <span className="mr-2">←</span> BACK TO TOP
        </a>
      </div>
    </section>
  );
};

export default TechStack;
